description:
Titled as The Flight Commander but listed as The Dawn Patrol.  This is not the 1928 version.  I&amp;#039;m still trying to find that one.

The story is about the young fliers 1915 in the Great War (WWI).  The dialog is typical of the late 20s early 30s.  It shows the agony of spirit of innocent young men at war for whom the glory is gone.  It also shows the guilt of officers that care.  This is a must have.

Full screen, black and white, dvd rip, avi, this is very good quality considering how old the original was.  You will like it.  English only, no subs.
